  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:11.745867\",\n\t\"name\": \"bear-river-migratory-bird-refuge-annual-narrative-report-calendar-year-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Bear River
  Migratory Bird Refuge outlines Refuge accomplishments during the 1985 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the research and investigations.
  Refuge administration is outlined; information about personnel, funding, and safety
  is given. Habitat management is also covered; subjects include wetlands, forests,
  and grasslands. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, migratory birds, game mammals, fisheries resources,
  and disease prevention and control. The public uses of the Refuge described in this
  report include interpretive programs, recreational uses, and law enforcement. The
  equipment and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, communication systems,
  and energy conservation. Items of interest are provided at the end. Photographs
  and newspaper articles are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
